import "./style/main.css";
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import Home from "./pages/Home";
import Collection from "./pages/Collection";

function App() {
	return (
		<Router>
			<div className='App'>
				<Route path='/one' element={<Home />} />
			</div>
			<Route path='/Collection'>
				<Collection />
			</Route>
		</Router>
	);
}

export default App;
